import { useDispatch, useSelector } from "react-redux";
import {
  fetchReposAction,
  fetchProfileAction,
} from "./redux/slices/reposSlice";
import { useEffect } from "react";
function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchReposAction("tweneboah"));
    dispatch(fetchProfileAction("tweneboah"));
  }, []);
  return (
    <div class="container mt-5 p-5 mb-5">
      <div class="row justify-content-center">
        <div class="col-md-5">
          <div class="card p-4">
            <div class="card-body text-center">
              <a href="index.html">
                <img
                  src="https://www.wepora.com/asset/img/wepora.png"
                  alt="wepora"
                  width="83px"
                />
              </a>
            </div>
            <div class="text-center">
              <div class="mt-4">
                <div class="logout-checkmark"></div>
              </div>
              <p class="text-muted mt-2">
                {" "}
                A email has been send to <b>shrikant@wepora.com</b>. Please
                check for an email from company and click on the included link
                to reset your password.
              </p>
              <a
                href="index.html"
                class="btn btn-primary btn-md btn-block btn-gradient waves-effect waves-light mt-3"
              >
                Back to Home
              </a>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
